INSERT INTO `HALLS` (`HALL_ID`, `CREATED_ON`, `DESCRIPTION`, `NAME`, `SEATS_COLUMNS`, `SEATS_ROWS`, `UPDATED_ON`, `PROVIDER_ID_FK`) VALUES
(1, '2023-06-15 20:56:53.300963', 'Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.', 'Dolby Atmos-A01', 20, 10, '2023-06-15 20:56:53.300977', 1),
(2, '2023-06-15 20:57:22.902543', 'Οι “Village Kids” είναι ειδικά διαμορφωμένες αίθουσες πρωτίστως για παιδιά που υπόσχονται να προσφέρουν μοναδικές στιγμές σε όλη την οικογένεια με τις καλύτερες νέες παιδικές ταινίες του παγκόσμιου κινηματογράφου σε πρώτη προβολή.', 'VKids-A02', 0, 5, '2023-06-15 20:57:22.902547', 1),
(3, '2023-06-15 20:57:42.523341', 'Στην Vmax των Village Cinemas στο The Mall Athens με την αποκλειστική εφαρμογή του premium μοντέλου \'Sphera\'. Η νέα αίθουσα \'Vmax Sphera\', η πρώτη στο είδος της στην Ευρώπη, υπόσχεται να αλλάξει την κινηματογραφική εμπειρία, με μία σειρά καινοτόμων τεχνολογικών και αισθητικών επιτευγμάτων.', 'Vmax Sphera-A03', 22, 18, '2023-06-15 20:57:42.523347', 1),
(4, '2023-06-15 20:57:59.376949', 'Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.', 'Dolby Atmos-B01', 18, 8, '2023-06-15 20:57:59.376953', 2),
(5, '2023-06-15 20:58:17.240072', 'Οι “Village Kids” είναι ειδικά διαμορφωμένες αίθουσες πρωτίστως για παιδιά που υπόσχονται να προσφέρουν μοναδικές στιγμές σε όλη την οικογένεια με τις καλύτερες νέες παιδικές ταινίες του παγκόσμιου κινηματογράφου σε πρώτη προβολή.', 'VKids-B02', 9, 4, '2023-06-15 20:58:17.240077', 2),
(6, '2023-06-15 20:58:36.665279', 'Στην Vmax των Village Cinemas στο The Mall Athens με την αποκλειστική εφαρμογή του premium μοντέλου \'Sphera\'. Η νέα αίθουσα \'Vmax Sphera\', η πρώτη στο είδος της στην Ευρώπη, υπόσχεται να αλλάξει την κινηματογραφική εμπειρία, με μία σειρά καινοτόμων τεχνολογικών και αισθητικών επιτευγμάτων.', 'Vmax Sphera-B03', 20, 16, '2023-06-15 20:58:36.665283', 2),
(7, '2023-06-15 20:58:56.249189', 'Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.', 'Dolby Atmos-C01', 18, 12, '2023-06-15 20:58:56.249193', 3);
