(1, 'Robert Downey Jr., Chris Evans, Scarlett Johansson', 'PG-13', '2023-06-15 20:11:47.295780', 'Earth\'s mightiest heroes must come together and learn to fight as a team if they are going to stop the mischievous Loki and his alien army from enslaving humanity.', 'Joss Whedon', 83, , 'data:image/jpeg;base64', 'the-avengers-image.jpg', 'The Avengers', 524, 8, 'Joss Whedon(screenplay), Zak Penn(story)', 'https://www.youtube.com/watch?v=eOrNdBpGMv8', '2023-06-15 20:11:47.295801', 2012);
