(2, 'Paul Rudd,Michael Douglas,Corey Stoll', 'PG-13', '2023-06-15 20:51:35.429904', 'Armed with a super-suit with the astonishing ability to shrink in scale but increase in strength, cat burglar Scott Lang must embrace his inner hero and help his mentor, Dr. Hank Pym, pull off a plan that will save the world.', 'Peyton Reed', 97, , 'data:image/jpeg;base64', 'ant-man-image.jpg', 'Ant-Man', 652, 7.3, 'Edgar Wright,Joe Cornish, Adam McKay', 'https://www.youtube.com/watch?v=pWdKf3MneyI', '2023-06-26 17:38:29.458821', 2015);
