(3, 'Liam Neeson, Ralph Fiennes, Ben Kingsley', 'R', '2023-06-15 20:52:27.876395', 'In German-occupied Poland during World War II, industrialist Oskar Schindler gradually becomes concerned for his Jewish workforce after witnessing their persecution by the Nazis.', 'Steven Spielberg', 195, , 'data:image/jpeg;base64', 'schindler\'s-list-image.jpg', 'Schindler\'s List', 195, 9, 'Thomas Keneally, Steven Zaillian', 'https://www.youtube.com/watch?v=gG22XNhtnoY', '2023-06-15 20:52:27.876414', 1993);
