(4, 'Michael B. Jordan, Tessa Thompson, Jonathan Majors', 'PG-13', '2023-06-15 20:53:48.813961', 'Adonis has been thriving in both his career and family life, but when a childhood friend and former boxing prodigy resurfaces, the face-off is more than just a fight.', 'Michael B. Jordan', 116, , 'data:image/jpeg;base64', 'creed-3-image.jpg', 'Creed III', 72, 6.8, 'Keenan Coogler, Zach Baylin, Ryan Coogler', 'https://www.youtube.com/watch?v=AHmCH7iB_IM', '2023-06-26 17:39:01.596335', 2023);
