(5, 'Daniel Radcliffe, Emma Watson, Rupert Grint', 'PG', '2023-06-15 20:54:46.512226', 'Harry Potter, Ron and Hermione return to Hogwarts School of Witchcraft and Wizardry for their third year of study, where they delve into the mystery surrounding an escaped prisoner who poses a dangerous threat to the young wizard.', 'Alfonso Cuarón', 142, , 'data:image/jpeg;base64', 'harry-potter-prisoner-of-azkaban-image.jpg', 'Harry Potter and the Prisoner of Azkaban', 410, 7.9, 'J.K. Rowling, Steve Kloves', 'https://www.youtube.com/watch?v=lAxgztbYDbs', '2023-06-26 17:39:17.906545', 2004);
