(6, 'Keanu Reeves, Michael Nyqvist, Alfie Allen', 'R', '2023-06-23 21:31:26.804295', 'An ex-hitman comes out of retirement to track down the gangsters who killed his dog and stole his car.', 'Chad Stahelski, David Leitch', 101, , 'data:image/jpeg;base64', 'john-wick-image.jpg', 'John Wick', 94, 7.4, 'Derek Kolstad', 'https://www.youtube.com/watch?v=C0BMx-qxsP4', '2023-06-26 17:39:34.129295', 2014);
INSERT INTO `PROVIDERS` (`PROVIDER_ID`, `ADDRESS`, `CREATED_ON`, `DESCRIPTION`, `GOOGLE_MAPS_SRC`, `NAME`, `PHONE`, `UPDATED_ON`) VALUES
(1, 'Ανδρέα Παπανδρέου 35 - Μαρούσι 35 Andrea Papandreou - Maroussi, Ανδρέα Παπανδρέου 35, Μαρούσι 151 22', '2023-06-15 20:55:16.802040', 'Το The Mall Athens βρίσκεται στο Μαρούσι, δίπλα στο Ολυμπιακό Στάδιο και με πρόσβαση από κάθε σημείο της Αττικής. Είναι το πρώτο και μεγαλύτερο διεθνούς επιπέδου Εμπορικό και Ψυχαγωγικό Κέντρο της Αθήνας και έχει δημιουργήσει μια νέα εποχή στις αγοραστικές και ψυχαγωγικές επιλογές των επισκεπτών. Με 160 επώνυμες εμπορικές αλυσίδες, 17 εστιατόρια και καφέ, 14 πρωτοποριακές κινηματογραφικές αίθουσες και χώρους αναψυχής και διασκέδασης για όλη την οικογένεια που αναπτύσσονται σε 5 επίπεδα και 3 υπόγειους χώρους, υποδέχεται τον επισκέπτη για όλες του τις ανάγκες χαλάρωσης, αγορών και διασκέδασης. Διαθέτει άμεση και εύκολη πρόσβαση σε σημαντικές οδικές αρτηρίες και μέσα μαζικής μεταφοράς, όπως: Αττική Οδός, Λεωφόρος Κηφισίας, Προαστιακός Σιδηρόδρομος, ΜΕΤΡΟ, Λεωφορειακές Γραμμές του ΟΑΣΑ, ΗΣΑΠ και Δημοτική Συγκοινωνία Αμαρουσίου. Το κέντρο διαθέτει συνολικά 2100 θέσεις parking κατανεμημένες σε 3 επίπεδα (-1, -2 και -3). Τόσο οι χώροι του εμπορικού κέντρου όσο και οι χώροι της Village είναι πλήρως προσβάσιμοι σε άτομα με ειδικές ανάγκες.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d8150.06459981036!2d23.784106067153306!3d38.040578686703356!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14a198c130d24143%3A0x46397c352cf10818!2zzprOuc69zrfOvM6xz4TOv86zz4HOrM-Gzr_PgiBWaWxsYWdl!5e0!3m2!1sel!2sgr!4v1677692370990!5m2!1sel!2sgr', 'Village @ The Mall Athens', '2102345325', '2023-06-15 20:55:16.802056'),
(2, '228 Thivon Av. & Parnassou - Rentis Θηβών 228 &, Παρνασσού Ρέντης, Αγ. Ιωάννης Ρέντης 182 33', '2023-06-15 20:55:42.858993', 'To Village Shopping & More... στην περιοχή του Αγ. Ιωάννη Ρέντη, αποτελεί ένα πρωτοποριακό έργο ανάπτυξης για τα ελληνικά δεδομένα, με 20 αίθουσες συνολικής χωρητικότητας 4.194 ατόμων.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d75336.21070604351!2d23.64474918572165!3d38.034139493096056!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14a1bc8287399d47%3A0xe1501b3fb53f2a2b!2sVILLAGE%20CINEMAS%20-%20RENTIS!5e0!3m2!1sel!2sgr!4v1677692889475!5m2!1sel!2sgr', 'VILLAGE CINEMAS - RENTIS', '2102704800', '2023-06-15 20:55:42.859009'),
(3, 'Υμηττού 110 &, Χρεμωνίδου, Παγκράτι 116 34', '2023-06-15 20:56:11.590065', 'Στο εμπορικό κέντρο Millennium του Παγκρατίου, θα βρείτε τα Village 5 Cinemas με χωρητικότητα 784 ατόμων. Διαθέτoυν 5 αμφιθεατρικές αίθουσες με υπερσύγχρονα συστήματα προβολής και οθόνες μεγάλων διαστάσεων, εκ των οποίων 1 αίθουσα με δυνατότητα προβολής 3D ταινίων (αίθουσα 5)', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d50294.70563159058!2d23.653711871964276!3d38.01400791198718!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14a1bd68ff9a654f%3A0xbd517be783da6b0a!2zVmlsbGFnZSBDaW5lbWFzIC0gzqDOsc6zzrrPgc6sz4TOuQ!5e0!3m2!1sel!2sgr!4v1678010496448!5m2!1sel!2sgr', 'Village Cinemas - Παγκράτι', '2102704800', '2023-06-15 20:56:11.590080');
